import React from "react";
import styles from "./ResultsTable.module.css";

const ResultsTable = (props) => {
  return (
    <table className={styles.result}>
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      <tbody>
        {props.yearlyData.map((yearlyData) => (
          <tr>
            <td>{yearlyData.year}</td>
            <td>{yearlyData.savingsEndofYear}</td>
            <td>{yearlyData.yearlyInterest }</td>
            <td>{yearlyData.savingsEndofYear - props.initialInvestment
             - yearlyData.yearlyContribution * yearlyData.year}</td>
            <td>{console.log(yearlyData.savingsEndofYear)}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ResultsTable;
